import { Form, Formik } from 'formik'
import React from 'react'
import FormikInput from './Formik/FormikInput'
import axios from 'axios'

const CreateHTLocation = () => {
    let getAttributes = async() => {
        let result = await axios({})
    }
    let initialValues = {
        hTName: "",
        location: "",
        length: {},
        elevationGain: {},
        description: "",
        startLatitude: {},
        end: {},
        attributes: [],
    }
    let onSubmit=() => {}
  return (
    <Formik
        initialValues={initialValues}
        // validationSchema={}
        onSubmit={onSubmit}
    >

        {(formik) => {
            return <Form>
                <FormikInput
                id="hTName"
                label="Hike/Trek name"
                type="text"
                name="hTName"
                onChange={(e) => {formik.setFieldValue("hTName", e.target.value)}}
                required={true}
                ></FormikInput>
                <br></br>
                <FormikInput
                id="location"
                label="Location"
                type="text"
                name="location"
                onChange={(e) => {formik.setFieldValue("location", e.target.value)}}
                required={true}
                ></FormikInput>
                <br></br>
                <FormikInput
                id="hTName"
                label="Hike/Trek name"
                type="text"
                name="hTName"
                onChange={(e) => {formik.setFieldValue("hTName", e.target.value)}}
                required={true}
                ></FormikInput>
                <br></br>
                <FormikInput
                id="hTName"
                label="Hike/Trek name"
                type="text"
                name="hTName"
                onChange={(e) => {formik.setFieldValue("hTName", e.target.value)}}
                required={true}
                ></FormikInput>
            </Form>
        }}
    </Formik>
  )
}

export default CreateHTLocation
